  - name: TEXT4000
    number: '6'
    value: 'Upon further reconciliation of activity during the reporting period, we
      identified the following changes on the August Monthly report and submit this
      amended report to reflect these changes:  Our amended report reflects an additional
      transfer of allocated nonfederal funds for payroll in the amount of $5,500 on
      Line 18, a correction to un-itemized contributions in the amount of $45.00 on
      Line A ii and expenditures in the amount of $1,200 reflected on Line 22.  Schedule
      B, Line 21(b) reports reimbursements for travel expenses which are not itemized
      because they do not exceed the $200 itemization level and do not exceed the
      $200 aggregate per vendor amount.  With respect to the expenditures made by
      the Party for payroll, payroll taxes, and other payroll or employee benefit-related
      expenses, the Party adheres to 11 CFR 300.33, and also follows the Commissions
      revision of the rules as adopted on December 1, 2005. Specifically, the Party
      pays for these costs with 100% federal funds when the employee spends more than
      25 percent of his or her time in a month on federal election activity (FEA)
      or activity in connection with a federal election. These expenditures are reported
      on Schedule B for Line 30b.  Alternatively, when an employee does not meet the
      25 percent threshold, the Party allocates these costs as an overhead/administrative
      expense, and reports these disbursements on a Schedule H4 for Line 21a. Respectfully
      submitted, Wayne Tucker, Treasurer'
